import XCTest
@testable import Hudl

class HTTPServiceTest: XCTestCase {
    var subject: HTTPService!
    let session = MockURLSession()

    override func setUp() {
        super.setUp()
        subject = HTTPService(session: session)
    }

    func test_getChannelId() {
        let nextDataTask = URLSessionDataTaskMock()
        session.nextDataTask = nextDataTask
        session.nextDataResponse = channelIdData()
        subject.getChannelId(forCategory: "HudlChannel") { (data, response, error) in
            XCTAssertNil(error, "getChannelId Error ")
        }
        subject.getChannelId(forCategory: "HudlChannel") { (data, response, error) in
            XCTAssertNil(error, "getChannelId Error ")
        }
    }

    func test_getVideos() {
        let nextDataTask = URLSessionDataTaskMock()
        session.nextDataTask = nextDataTask
        session.nextDataResponse = getVideosResponse()
        session.nextURLResponse = URLResponse(url: URL(string:"https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=30&playlistId=123&key=AIzaSyC5OHZkDYt6A9igTuVBadYigPw8VFnkqLg")!, mimeType: "", expectedContentLength: 10, textEncodingName: "" )
        subject.getVideos(fromChannelId: "123") { (data, response, error) in
            XCTAssertNil(error, "getVideos Error ")
        }
        subject.getVideos(fromChannelId: "123") { (data, response, error) in
            XCTAssertEqual(response?.url?.absoluteString, "https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=30&playlistId=123&key=AIzaSyC5OHZkDYt6A9igTuVBadYigPw8VFnkqLg")
            XCTAssertNil(error, "getChannelId Error ")
        }
    }

